import React, { Component } from 'react';

class TechList extends Component {
  state = {
    techs: [
      'NodeJS',
      'ReactJS',
      'React Native'
    ]
  };

  render() {

    return (
      <>
        <ul>
          {this.state.techs.map(item => <li key={item}>{item}</li>)}
        </ul>
        <input type="text" />
      </>
    );
  }
};

export default TechList;
